import React from 'react';
import ReactDOM from 'react-dom';
import './index.js';
import App from './App';
import Img from './Componentes/Img';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <Img />
  </React.StrictMode>,
  document.getElementById('root')
);
